import Layout from '../components/MyLayout'
import Link from 'next/link'

const PostLink = props => {
    <li>
        <Link href={`/post?title=${props.tilte}`}>
            <a>{props.title}</a>
        </Link>
    </li>
}

export default function Index() {
    return (
        <div>
            <Layout>
                <p>Hello Next.js</p>
            </Layout>
        </div>
    )
}
